import { configureStore } from '@reduxjs/toolkit';
import { rootReducer } from './contactsSlice';
import {
  persistReducer,
  FLUSH,
  REHYDRATE,
  PAUSE,
  PERSIST,
  PURGE,
  REGISTER,
} from 'redux-persist';

export const store = configureStore({ reducer: rootReducer });
